:local(.connection_manager) {
    margin:0;
    padding:0;
    width: 100%;
    height:40vh;
}

:local(.row_container) {
    margin:0;
    padding:0;
    width: 100%;
    height:40vh;
}

:local(.row_container div) {
    margin: 0;
    padding: 0;
}


:local(.button_start) {

    background-color: #399ccd;
    border-color: #2d90c1;
    text-shadow: 0 1px 0.1em #2d90c1;


    height: calc(100% - 30px);
    width: calc(100% - 25px);
    border-radius: .25em;
    border-style: solid;
    border-width: 1px;
    z-index: 2;
    display: flex;
    justify-content: center;
    align-items: center;

    margin: 15px 15px 15px 10px;
}


:local(.button_stop) {

    background-color: #e76a00;
    border-color: #da5e00;
    text-shadow: 0 1px 0.1em #da5e00;


    height: calc(100% - 30px);
    width: calc(100% - 25px);
    border-radius: .25em;
    border-style: solid;
    border-width: 1px;
    z-index: 2;
    display: flex;
    justify-content: center;
    align-items: center;

    margin: 15px 15px 15px 10px;
}

:local(.chat) {
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);

}
